-- ----------------------------
-- Procedure structure for stock_calculate
-- ----------------------------
DROP PROCEDURE IF EXISTS `stock_calculate`;
DELIMITER ;;
CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `stock_calculate`()
BEGIN

update stock_data sd set sd.total_B = (select sum(deal) from stock_trade st where st.bs = 'B' and st.trade_date=sd.data_time and st.stock_id=sd.stock_id);

update stock_data sd set sd.total_S = (select sum(deal) from stock_trade st where st.bs = 'S' and st.trade_date=sd.data_time and st.stock_id=sd.stock_id);

END
;;
DELIMITER ;

-- ----------------------------
-- Event structure for data_change
-- ----------------------------
DROP EVENT IF EXISTS `data_change`;
DELIMITER ;;
CREATE DEFINER=`root`@`127.0.0.1` EVENT `data_change` ON SCHEDULE EVERY 24 HOUR STARTS '2018-01-30 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO CALL stock_calculate
;;
DELIMITER ;
